import React from "react"
import NavigationButton from "./NavigationButton"

class Navigation extends React.Component {
  constructor(props) {
    super(props)

    this.handleChange = this.handleChange.bind(this)
  }

  handleChange() {
    this.props.changePageValue(1)
  }

  render() {
    return (
    <nav className="navigation-container" onClick={console.log(122)} >
      <NavigationButton key={0} page={0}  />
      <NavigationButton key={1} page={1} onClick={this.handleChange} />
      <NavigationButton key={2} page={2} onClick={this.handleChange} />
      <NavigationButton key={3} page={3} onClick={this.handleChange} />
    </nav>
    )
  }
}

export default Navigation
